import math

def can_transform_sequence(N, B):

    def fun(i):
        t = False
        for j in B:
            if math.gcd(i + 1, j) == B[i]:
                t = True
                break
        return t
    c = 1
    for i in range(N):
        if B[i] == i + 1 or fun(i):
            c += 1
        else:
            return 'NO'
    return 'YES' if c == N else 'NO'

